INSERT INTO `page_languages` (`id`, `title`, `slug`, `description`, `contents`, `meta_seo`, `language`, `page_id`) VALUES
	(1, 'Liên hệ', 'lien-he', NULL, '<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><span style="box-sizing: border-box; color: rgb(255, 0, 0);"><strong style="box-sizing: border-box;">CÔNG TY TNHH ĐẦU TƯ XNK ROYAL</strong></span></p>\r\n\r\n<ul style="box-sizing: border-box; list-style-position: initial; list-style-image: initial; margin-top: 0px; padding-right: 0px; padding-left: 0px; margin-bottom: 1.3em; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">\r\n	<li class="location" style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;"><span class="street-address" style="box-sizing: border-box;">Trụ sở HCM: 78/k10 Cộng Hòa, P.4, Tân Bình</span></li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">VPGD HCM: 201 Cách mạng tháng 8, P.4, Q3</li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Tư vấn bán hàng Hồ Chí Minh: <strong style="box-sizing: border-box;">0931 305 789</strong></li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;"><span class="street-address" style="box-sizing: border-box;">CN tại HN: E3B, Ecohome 1, P.Đông Ngạc, Bắc Từ Liêm</span></li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">VPDG tại HN: 58 Trần Vĩ, Q. Cầu Giấy</li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Tư vấn bán hàng Hà Nội: <strong style="box-sizing: border-box;">0849.788.111</strong></li>\r\n	<li class="email" style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Email: Royalwines.vip@gmail.com</li>\r\n</ul>', '{"title":null,"keywords":null,"description":null}', 'vi', 1),
	(2, 'Giới thiệu', 'gioi-thieu', NULL, '<h1 style="margin: 20px 0px 10px; padding: 0px; box-sizing: border-box; text-size-adjust: 100%; line-height: 36px;"><font color="#ff6600" face="arial, helvetica, sans-serif"><span style="font-size: 18px;"><b>VỀ CHÚNG TÔI - VANG CHẤT </b></span></font></h1>\r\n\r\n<h1 style="margin: 20px 0px 10px; padding: 0px; box-sizing: border-box; text-size-adjust: 100%; line-height: 36px;"><span style="font-family: Tahoma, Arial, sans-serif; font-size: 14px;">Công ty TNHH đầu tư XNK Royal với kinh nghiệm nhiều năm trong lĩnh vực nhập khẩu và cung cấp các sản phẩm rượu vang. Tất cả các sản phẩm của chúng tôi đều là những thương hiệu nổi tiếng thế giới và được lựa chọn kỹ lưỡng bởi các chuyên gia nếm thử hàng đầu Việt Nam, bên cạnh đó khâu bảo quản sản phẩm theo đúng tiêu chuẩn luôn được chúng tôi chú trọng để mang đến cho khách hàng những sản phẩm chất lượng nhất…</span></h1>', '{"title":null,"keywords":null,"description":null}', 'vi', 2),
	(3, 'Footer', 'footer', NULL, '<p>CHI NHÁNH HÀ NỘI                                                                                                                      SHOWROOM HÀ NỘI<br />\r\nĐịa chỉ: E3B, Ecohome 1, P.Đông Ngạc, Bắc Từ Liêm, Hà Nội                                            Địa chỉ: 65 Nguyễn Xuân Khoát, Ngoại Giao Đoàn, Q.Tây Hồ, Hà Nội<br />\r\nPhone: 0849 788 111                                                                                                                      Điện thoại: 0847 488 111<br />\r\nRoyalwines.hn@gmail.com                                                                                                         Royalwines.hn@gmail.com</p>', '{"title":null,"keywords":null,"description":null}', 'vi', 3);
