INSERT INTO `post_languages` (`id`, `title`, `slug`, `description`, `contents`, `attributes`, `meta_seo`, `language`, `post_id`) VALUES
	(42, 'TUYỂN DỤNG', 'tuyen-dung', NULL, '<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><strong>Signal Smart Lock tuyển dụng Trưởng phòng Kinh Doanh</strong></span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><strong>Số lượng: 01 nhân viên</strong></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><strong><span style="border:none windowtext 1.0pt;padding:0in;">Quyền lợi</span></strong></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Bảo hiểm theo quy định nhà nước.</span></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Hoạt động team building thường xuyên</span></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Làm việc trong môi trường trẻ, năng động, hòa đồng, vui vẻ </span></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Lương cứng từ 10 -20 triệu ( theo năng lực )</span></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Phụ cấp hấp dẫn: 3.000.000/ tháng</span></span></span></span></p>\r\n\r\n<p align="left" style="margin-top:0in;margin-right:-11.25pt;margin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="border:none windowtext 1.0pt;padding:0in;">- Thu nhập = lương cứng + phụ cấp + lương kinh doanh+ thưởng. Thu nhập không giới hạn.</span></span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><strong>YÊU</strong><strong> CẦU ỨNG VIÊN</strong></span></span></span></p>\r\n\r\n<p align="left" style="margin-top