vetica, sans-serif"><span style="font-size: 16px;">Chưa có kinh nghiệm được đào tạo</span></font></li>\r\n	<li><font color="#000000" face="arial, helvetica, sans-serif"><span style="font-size: 16px;">Có máy tính cá nhân</span></font></li>\r\n</ul>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><strong>ĐỊA ĐIỂM, THỜI GIAN LÀM VIỆC</strong></span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;">- Địa điểm: Tầng 11B, Khách sạn Thể Thao làng sinh viên Handico, 15 Lê Văn Thiêm, Hà Nội</span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;">- Thời gian làm việc: 8h -17h30 Nghỉ trưa 1,5h; từ Thứ 2 đến sáng thứ 7. </span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;">Ứng viên quan tâm vui lòng gửi cv về email: sslock.vn@gmail.com</span></span></span></p>\r\n\r\n<p align="left" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:left;line-height:normal;background:white;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;">Liên hệ trực tiếp: 0833170697</span></span></span></p>', NULL, '{"title":"Tuy\\u1ec3n D\\u1ee5ng | c\\u01a1 h\\u1ed9i ngh\\u1ec1 nghi\\u1ec7p | sslock.vn","keywords":"tuy\\u1ec3n d\\u1ee5ng Tr\\