	(46, 'Chính sách đổi trả hàng', 'chinh-sach-doi-tra-hang', NULL, '<header class="entry-header" font-size:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(10, 10, 10); font-family: ">\r\n<h1 class="entry-title mb uppercase" style="box-sizing: border-box; color: rgb(51, 51, 51); width: 1190px; margin: 0px 0px 30px; text-rendering: optimizespeed; font-size: 22px; font-weight: 700; letter-spacing: 0.05em; text-transform: uppercase; border-bottom: 2px solid rgb(28, 28, 26);">CHÍNH SÁCH ĐỔI TRẢ HÀNG</h1>\r\n</header>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Trong các trường hợp sau, hãy liên hệ ngay với chúng tôi để được đổi trả hàng trong thời gian sớm nhất:</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Sản phẩm bị lỗi, hỏng hoặc do vận chuyển.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Gửi sai sản phẩm.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Lỗi do nhầm lẫn của nhân viên tư vấn</p>\r\n\r\n<p> </p>', NULL, '{"title":"Ch\\u00ednh s\\u00e1ch \\u0111\\u1ed5i tr\\u1ea3 h\\u00e0ng","keywords":null,"description":"Ch\\u00ednh s\\u00e1ch \\u0111\\u1ed5i tr\\u1ea3 h\\u00e0ng"}', 'vi', 26),
	(48, 'Hình Thức Thanh Toán', 'hinh-thuc-thanh-toan', NULL, '<header class="entry-header" style="box-sizing: border-box; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">\r\n<h1 class="entry-title mb uppercase" style="box-sizing: border-box; color: rgb(51, 51, 51); width: 1190px; margin: 0px 0px 30px; text-rendering: optimizespeed; font-size: 22px; font-weight: 700; letter-spacing: 0.05em; text-transform: uppercase; border-bottom: 2px solid rgb(28, 28, 26);">CHÍNH SÁCH THANH TOÁN</h1>\r\n</header>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><em style="box-sizing: border-box;">Chính sách thanh toán linh hoạt cho khách hàng sử dụng dịch vụ của Royalwine. Các bạn sẽ thấy thuận tiện khi giao dịch với chúng tôi: Quý khách có thể thanh toán với chúng tôi theo các phương thức sau.</em></p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"> </p>\r\n\r\n<h2 style="box-sizing: border-box; color: rgb(54, 4, 4); width: 1190px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-weight: 700;"><span id="1_Thanh_toan_bang_tien_mat" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">1. Thanh toán bằng tiền mặt:</span></h2>\r\n\r\n<ul style="box-sizing: border-box; list-style-position: initial; list-style-image: initial; margin-top: 0px; padding-right: 0px; padding-left: 0px; margin-bottom: 1.3em; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Quý khách có thể thanh toán trực tiếp bằng tiền mặt khi mua hàng tại các hệ thống cửa hàng của Royal Wine.</li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Khi khách hàng mua hàng trực tuyến, hoặc mua hàng từ xa quý khách có thể nhận hàng tại địa điểm giao hàng đã thỏa thuận. Việc thanh toán chi phí vận chuyển sẽ tuân theo chính sách vận chuyển của Royal Wine hoặc do các bên thỏa thuận.</li>\r\n</ul>\r\n\r\n<h2 style="box-sizing: border-box; color: rgb(54, 4, 4); width: 1190px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-weight: 700;"><span id="2_Chinh_sach_thanh_toan_truc_tuyen" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">2. Chính sách thanh toán trực tuyến:</span></h2>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">Quý khách có thể thanh toán trực tuyển theo các bước sau:</p>\r\n\r\n<ul style="box-sizing: border-box; list-style-position: initial; list-style-image: initial; margin-top: 0px; padding-right: 0px; padding-left: 0px; margin-bottom: 1.3em; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Nộp tiền mặt tại ngân hàng hoặc chuyển khoản đến tài khoản của<a href="https://vangchat.com.vn/gioi-thieu-royal-wine-ruou-vang-nhap-khau/" style="box-sizing: border-box; background-color: transparent; touch-action: manipulation; color: rgb(51, 72, 98); text-decoration-line: none;"> Royal Wine</a> trong đó ghi đầy đủ các thông tin như: Tên khách hàng, số tiền, nội dung chuyển khoản</li>\r\n	<li style="box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;">Thông báo cho Royal Wine ngay sau khi quý khách đã thực hiện chuyển tiền/chuyển khoản.</li>\r\n</ul>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">Ngay sau khi nhận được thông báo xác nhận từ phía ngân hàng, chúng tôi sẽ tiến hành thông báo lại cho quý khách đồng thời xuất hàng giao cho quý khách trong thời gian theo quy định.</p>\r\n\r\n<div>\r\n<h3 font-size:="" lucida="" style="margin: 4px 0px; padding: 0px; outline: none medium; color: rgb(0, 0, 0); font-family: Helvetica, Arial, "> </h3>\r\n</div>', NULL, '{"title":"H\\u00ecnh Th\\u1ee9c Thanh To\\u00e1n","keywords":null,"description":"Nh\\u1eb1m thu\\u1eadn ti\\u1ec7n cho vi\\u1ec7c thanh to\\u00e1n v\\u1edbi c\\u00e1c kh\\u00e1ch h\\u00e0ng \\u1edf xa ho\\u1eb7c thanh to\\u00e1n qua th\\u1ebb, ch\\u00fang t\\u00f4i \\u0111\\u00e3 m\\u1edf t\\u00e0i kho\\u1ea3n \\u1edf h\\u1ea7u h\\u1ebft c\\u00e1c ng\\u00e2n h\\u00e0ng, qu\\u00fd kh\\u00e1ch c\\u00f3 th\\u1ec3 ch\\u1ecdn..."}', 'vi', 28),
	(69, 'Chính sách và quy định chung', 'chinh-sach-va-quy-dinh-chung', NULL, '<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">1.1. Quyền và nghĩa vụ của bên A:<br style="box-sizing: border-box;" />\r\nQuyền của bên A:<br style="box-sizing: border-box;" />\r\n– Bên A có quyền đơn phương chấm dứt hợp đồng trong trường hợp bên B không thực hiện đúng theo hợp đồng hoặc vi phạm các nội quy chính sách đã đề ra trong hợp đồng.<br style="box-sizing: border-box;" />\r\n– Bên A có quyền yêu cầu Bên B thanh toán tiền theo hợp đồng và bồi thường thiệt hại cho Bên A trong bất kỳ trường hợp Bên B không thực hiện đúng theo hợp đồng đã ký của 2 bên gây tổn thất, thiệt hại cho Bên A.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Nghĩa vụ của bên A:<br style="box-sizing: border-box;" />\r\n– Giao hàng hoặc bàn giao dịch vụ đúng như thỏa thuận trong hợp đồng đúng hạn.<br style="box-sizing: border-box;" />\r\n– Cung cấp cho Bên B các thông tin cần thiết liên quan đến dịch vụ hoặc sản phẩm.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">1.2. Quyền và nghĩa vụ của bên B:<br style="box-sizing: border-box;" />\r\nQuyền của bên B:<br style="box-sizing: border-box;" />\r\n– Bên B có quyền không nhận hàng hoặc ký nghiệm thu dịch vụ nếu chất lượng không đạt như thỏa thuận đã ghi trong hợp đồng.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Nghĩa vụ của bên B :<br style="box-sizing: border-box;" />\r\n– Thực hiện việc thanh toán đúng theo các điều khoản trong hợp đồng đúng hạn.<br style="box-sizing: border-box;" />\r\n– Khi nhận hàng có trách nhiệm kiểm tra số lượng, chất lượng đối chiếu với biên bản bàn giao nhằm tránh phát sinh sau bán hàng, dịch vụ</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">2. Quy định và hình thức thanh toán</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">2.1. Phương thức thanh toán:<br style="box-sizing: border-box;" />\r\nBên B thanh toán bằng tiền mặt hoặc chuyển khoản cho bên A theo giá trị Hợp Đồng đã ký (có thể chia thành nhiều đợt)</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">2.2. Thời hạn thanh toán:<br style="box-sizing: border-box;" />\r\n– Bên B thanh toán tiền hàng cho Bên A ngay khi ký biên bản nghiệm thu không quá 5 ngày kể từ ngày bàn giao.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">3. Chính sách vận chuyển/giao nhận/cài đặt:</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">3.1. Thời điểm – địa điểm giao nhận hàng hóa, sản phẩm:<br style="box-sizing: border-box;" />\r\n– Bên A bàn giao hàng, sản phẩm tại địa điểm của Bên B hoặc bên A nhằm thuận tiện nhất cho cả 2 bên.<br style="box-sizing: border-box;" />\r\n– Hàng hóa được giao thành một hoặc nhiều đợt tùy theo số lượng, nhu cầu trên đơn hàng và được sự chấp thuận của hai bên.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">3.2. Phương thức giao nhận:<br style="box-sizing: border-box;" />\r\nHàng hóa được giao nhận hoàn tất kể từ khi Bên B ký Biên Nhận Bàn Giao của Bên A về việc đã nhận hàng.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">4. Chính sách bảo hành/bảo trì</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Bên A có chính sách bảo hành và bảo trì tùy theo dịch vụ Bên B đăng ký theo như trong Hợp Đồng đã ký</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">5. Chính sách đổi/trả hàng và hoàn tiền</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Bên A cam kết cho phép đổi/trả hàng và hoàn tiền nếu sản phẩm không đúng chất lượng như trong hợp đồng đã cam kết.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">6. Chính sách bảo mật thông tin</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Thông tin khách hàng sẽ được bảo mật và không bị hé lộ sang bất kỳ bên nào khác nhằm đảm bảo quyền lợi cho cả bên A và bên B. Mọi vấn đề về bảo hành sửa chữa chỉ được làm việc trực tiếp với người ký hợp đồng, hoặc người đại diện có giấy ủy quyền.</p>', NULL, '{"title":"Ch\\u00ednh S\\u00e1ch \\u0110\\u1ea1i L\\u00fd","keywords":null,"description":null}', 'vi', 49),
	(394, 'GIỚI THIỆU', 've-chung-toi', NULL, '<h2 style="box-sizing: border-box; color: rgb(54, 4, 4); width: 1190px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-weight: 700;"><span id="Gioi_thieu_chung_ve_Royal_Wine_8211_Ruou_vang_nhap_khau" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu chung về Royal Wine – Rượu vang nhập khẩu</span></h2>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;">“Bạn muốn mua rượu vang để phục vụ cho những bữa tiệc cùng bạn bè và gia đình, để biếu tặng, kinh doanh. Royal Wine sinh ra với sứ mệnh mang đến cho toàn thể quý khách hàng những nét đẹp về văn hóa rượu vang. Những kiến thức bổ ích và lợi ích của rượu vang, với những sản phẩm<a href="https://vangchat.com.vn/ruou-vang/" style="box-sizing: border-box; background-color: transparent; touch-action: manipulation; color: rgb(51, 72, 98); text-decoration-line: none;"> rượu vang</a> nhập khẩu chính hãng”</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px; text-align: justify;">Rượu vang là một trong những đồ uống được tiêu thụ nhiều hàng đầu Thế giới và có tuổi đời lên đến hàng nghìn năm. Ngày nay trong những bữa tiệc sang trọng đã dần trở nên không thể thiếu được sự kết hợp với rượu vang. Đồ uống duy nhất có thể kết hợp được với đồ ăn khiến những món ăn trở nên đậm đà và tinh tế hơn.</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px; text-align: justify;">Công ty TNHH đầu tư XNK Royal với nhiều năm kinh nghiệm trong lĩnh vực nhập khẩu và cung cấp các sản phẩm rượu vang chất lượng tốt nhất ở Việt Nam hiện nay. Tất cả các sản phẩm của chúng tôi đều từ những hầm rượu nổi tiếng trên thế giới. Và được lựa chọn kỹ lưỡng bởi các chuyên gia nếm thử hàng đầu Việt Nam.</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px; text-align: justify;">Đến với Royal Wine, quý khách sẽ được khám phá sự phong phú về các dòng rượu vang đến từ các quốc gia nổi tiếng trên thế giới. Bên cạnh đó, quý khách sẽ được nhân viên tư vấn tận tình và đặc biệt quý khách có thể <strong style="box-sizing: border-box;">nếm thử miễn phí</strong> trước khi quyết định chọn mua. Royal Wine cam kết cung cấp những chai rượu vang được nhập khẩu chính hãng. Mỗi chai rượu luôn có xuất xứ rõ ràng, đảm bảo chất lượng. Và luôn được bảo quản tốt nhất trong kho lạnh theo đúng tiêu chuẩn. Tại Royal Wine khách hàng sẽ được tận hưởng những dịch vụ mà khó có đơn vị nào cung cấp rượu vang nào đáp ứng được.</p>\r\n\r\n<h2 style="box-sizing: border-box; color: rgb(54, 4, 4); width: 1190px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-weight: 700;"><span id="Royal_Wine_cam_ket" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Royal Wine cam kết:</span></h2>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Uống thử rượu vang miễn phí:</strong> Mục tiêu tối thượng của chúng tôi là giúp bạn chọn loại rượu vang chuẩn gu của mình!</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Yên tâm về chất lượng của rượu:</strong> Toàn bộ rượu vang của Royal Wine được nhập khẩu trực tiếp từ nhà sản xuất. Và có đầy đủ giấy tờ hải quan để đảm bảo về chất lượng của sản phẩm.</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Đổi, trả sản phẩm nếu không vừa lòng:</strong> Duy nhất chỉ có tại Royal Wine. Chúng tôi luôn mong muốn khách hàng của mình được hài lòng nhất về sản phẩm mình đã mua</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Tư vấn cách thưởng thức cũng như chia sẻ các thông tin thú vị về rượu vang:</strong> Đội ngũ tư vấn tận tình giàu kinh nghiệm và website Vangchat.com.vn sẽ giúp bạn cảm thấy rượu vang thú vị và đặc sắc hơn bất cứ đồ uống nào khác.</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Đảm bảo giá tốt nhất thị trường: </strong>Chúng tôi luôn cung cấp những sản phẩm rượu vang nhập khẩu đúng nhất với giá trị thực của chai rượu</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Phục vụ 24/24, giao hàng miễn phí:</strong> Số hotline luôn luôn sẵn sàng phục vụ bạn, kể cả trong những dịp lễ tết, đội ngũ giao hàng luôn phục vụ khách hàng nhanh nhất,mọi nơi, mọi lúc</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">– Hỗ trợ về thiết kế, in ấn các sản phẩm truyền thông:</strong> Khách hàng là nhà hàng, cửa hiệu hoặc shop cá nhân có nhu cầu thiết kế menu, biển bảng… được chúng tôi hỗ trợ hoàn toàn miễn phí.</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">Royal Wine chân thành cảm ơn quý khách hàng đã quan tâm và ủng hộ trong suốt nhiều năm qua!</strong></p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">Quý khách có thể trực tiếp đến hệ thống Showroom của Royal Wine tại:</strong></p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, sans-serif&quot;, sans-serif; font-size: 16px;"><strong style="box-sizing: border-box;">Trụ sở HCM: 78/K10 Cộng Hòa, P4, quận Tân Bình  </strong>                             (xem bản đồ: <a href="https://www.google.com/maps/place/R%C6%B0%E1%BB%A3u+vang+ROYAL+WINE/@10.801899,106.65713,17z/data=!3m1!4b1!4m5!3m4!1s0x31752965ce42e115:0xfaf08a01e0a8a25f!8m2!3d10.801899!4d106.6593187" rel="noopener noreferrer" style="box-sizing: border-box; background-color: transparent; touch-action: manipulation; color: rgb(51, 72, 98); text-decoration-line: none;" target="_blank"><span style="box-sizing: border-box; text-decoration-line: underline;">Tại đây</span></a>)</p>\r\n\r\n<p style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: &quot;-apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen-Sans, Ubunt