INSERT INTO `product_languages` (`id`, `title`, `slug`, `description`, `contents`, `specifications`, `attributes`, `meta_seo`, `language`, `product_id`) VALUES
	(5777, 'Rượu vang Rosso Nobile Cherry', 'vang-rosso', 'Rượu vang Rosso Nobile Cherry', '<p class="product-name" font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box; font-size: 14.4px;"><em style="box-sizing: border-box;">Rượu vang Rosso Nobile Cherry được nhập khẩu và phân phối bởi Công ty TNHH đầu tư XNK Royal. Giao hàng miễn phí tại Hà Nội và TP.HCM 24/7.</em></strong></p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:="">Rượu vang Rosso Nobile Cherry  – Vị anh đào</h2>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""><strong style="color: rgb(10, 10, 10); font-size: 13px; box-sizing: border-box;">Rosso Nobile Cherry</strong><span style="color: rgb(10, 10, 10); font-size: 13px;"> </span><span lang="en-US" style="color: rgb(10, 10, 10); font-size: 13px; box-sizing: border-box;">kết hợp hương vị trái cây </span><span lang="en-US" style="color: rgb(10, 10, 10); font-size: 13px; box-sizing: border-box;">của nho đỏ với </span><span style="color: rgb(10, 10, 10); font-size: 13px; box-sizing: border-box;"><span lang="en-US" style="box-sizing: border-box;">hương  </span><span lang="en-US" style="box-sizing: border-box;">của anh đào đậm. </span></span><span lang="en-US" style="color: rgb(10, 10, 10); font-size: 13px; box-sizing: border-box;">Nếu bạn thích nó, không cần tìm đâu xa nữa – sự quyến rũ gấp đôi: rượu vang và hương anh đào – một sự kết hợp không thể cưỡng lại!</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Ẩm thực: </strong>Kết hợp tuyệt vời với các món thịt đỏ như bò bít tết, thịt lợn nướng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Phục vụ tốt nhất khi ướp lạnh ở nhiệt độ 16 – 18 độ C.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>', NULL, '[{"name":null,"value":null}]', '{"title":"R\\u01b0\\u1ee3u vang Rosso Nobile Cherry","keywords":"R\\u01b0\\u1ee3u vang Rosso Nobile Cherry","description":"R\\u01b0\\u1ee3u vang Rosso Nobile Cherry"}', 'vi', 5696),
	(5783, 'Rượu vang nổ Keos Pink Moscato', 'hotel-card-encoder', 'Rượu vang nổ Keos Pink Moscato được nhập khẩu và phân phối bởi Công ty TNHH đầu tư Xuất nhập khẩu Royal (Royal Wine). Giao hàng miễn phí Toàn Quốc.', '<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Gioi_thieu_ruou_vang_Tay_Ba_Nha" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu rượu vang Tây Ba Nha</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Rượu vang <strong style="box-sizing: border-box;">Tây Ban Nha</strong> có lịch sử từ lâu đời, đến nổi không ai biết người đầu tiên mang nho đến vùng đất này là ai. Cây nho đầu tiên được trồng trên vùng đất này khoảng từ 4000 – 3000 năm TCN. Nghề trồng nho đã được thiết lập. Rượu vang của nước này đã được giao dịch rộng rãi khắp Địa Trung Hải và Bắc Phi.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Rioja</strong> là vùng sản xuất rượu vang nổi tiếng  của Tây Ban Nha. Họ có hẳn một phân hạng rượu vang riêng và nổi bật với những chai vang đỏ được pha trộn từ giống nho <strong style="box-sizing: border-box;">Tempranillo</strong> và <strong style="box-sizing: border-box;">Garnacha</strong> đậm đà hương vị cùng khả năng lưu trữ tuyệt vời. Ngoài những chai vang đỏ, thì Rioja còn nổi tiếng bởi những chai vang trắng được làm từ giống nho bản địa Viura.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Thuong_thuc_ruou_vang_no_Keos_Pink_Moscato" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Thưởng thức rượu vang nổ Keos Pink Moscato</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Màu sắc: </strong>Rượu vang có màu hồng nhạt rất hấp dẫn.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Hương vị: H</strong>ương thơm của rượu là sự đan xem, hòa quyện, kết hợp của nhiều loại trái cây và gia vị đặc biệt trong đó có thể kể đến nho, táo, cam, chanh, bưởi, vanilla, hạnh nhân, hạt dẻ, gỗ sồi mang đến một hương vị hoàn hảo,</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Kết hợp món ăn:</strong> Kết hợp với hải sản, thịt trắng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Phục vụ:</strong> Nhiệt độ tuyệt vời nhất để thưởng thức rượu là 8 đến 10 độ C.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Dia_chi_mua_hang" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Địa chỉ mua hàng:</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại TP.HCM: <strong style="box-sizing: border-box;">78/k10 Cộng Hòa, P.4, Quận Tân Bình                  </strong>Hotline:<strong style="box-sizing: border-box;"> 0931.305.789</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại Hà Nội: <strong style="box-sizing: border-box;">65 Nguyễn Xuân Khoát, Ngoại Giao Đoàn              </strong>Hotline:<strong style="box-sizing: border-box;"> 0849.788.111</strong></p>', NULL, '[{"name":null,"value":null}]', '{"title":null,"keywords":null,"description":null}', 'vi', 5702),
	(5786, 'Rượu vang Rosso Nobile Alla Nocciola', 'ruou-vang-rosso-nobile-alla-nicciola', 'Rượu vang Rosso Nobile Alla Nocciola', '<p class="product-name" font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box; font-size: 14.4px;"><em style="box-sizing: border-box;">Rượu vang Rosso Nobile Alla Nocciola được nhập khẩu và phân phối bởi Công ty TNHH đầu tư XNK Royal. Giao hàng miễn phí tại Hà Nội và TP.HCM 24/7.</em></strong></p>\r\n\r\n<p class="product-name" font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong>Rượu vang Rosso Nobile Alla Nocciola – Vị hạt dẻ</strong></p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""> </h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Nếu như bạn đang tìm kiếm một chai rượu cho người phụ nữ của mình, thì những cô nàng ngọt ngào chắc hẳn sẽ không thể từ chối <strong style="box-sizing: border-box;">vang ngọt Đức vị hạt dẻ</strong> này được. Đặc biệt nhấn mạnh trong chai là hương vị độc đáo, có một không hai của trái cây chín với vị hạt dẻ. Hương vị mạnh mẽ đến mức bạn có thể cảm nhận được như mình đang ăn trái cây khi thưởng thức rượu.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Ẩm thực: </strong>Kết hợp tuyệt vời với các món thịt đỏ như bò bít tết, thịt lợn nướng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Phục vụ tốt nhất khi ướp lạnh ở nhiệt độ 16 – 18 độ C.</p>', NULL, '[{"name":null,"value":null}]', '{"title":"R\\u01b0\\u1ee3u vang Rosso Nobile Alla Nocciola","keywords":"R\\u01b0\\u1ee3u vang Rosso Nobile Alla Nocciola","description":"R\\u01b0\\u1ee3u vang Rosso Nobile Alla Nocciola"}', 'vi', 5705),
	(5789, 'Rượu vang nổ Keos Blue Moscato', 'khoa-thong-minh-d001d-fa', 'Rượu vang nổ Keos Blue Moscato được nhập khẩu và phân phối bởi Công ty TNHH đầu tư Xuất nhập khẩu Royal (Royal Wine). Giao hàng miễn phí Toàn Quốc.', '<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Gioi_thieu_ruou_vang_Tay_Ba_Nha" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu rượu vang Tây Ba Nha</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Rượu vang <strong style="box-sizing: border-box;">Tây Ban Nha</strong> có lịch sử từ lâu đời, đến nổi không ai biết người đầu tiên mang nho đến vùng đất này là ai. Cây nho đầu tiên được trồng trên vùng đất này khoảng từ 4000 – 3000 năm TCN. Nghề trồng nho đã được thiết lập. Rượu vang của nước này đã được giao dịch rộng rãi khắp Địa Trung Hải và Bắc Phi.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Rioja</strong> là vùng sản xuất rượu vang nổi tiếng  của Tây Ban Nha. Họ có hẳn một phân hạng rượu vang riêng và nổi bật với những chai vang đỏ được pha trộn từ giống nho <strong style="box-sizing: border-box;">Tempranillo</strong> và <strong style="box-sizing: border-box;">Garnacha</strong> đậm đà hương vị cùng khả năng lưu trữ tuyệt vời. Ngoài những chai vang đỏ, thì Rioja còn nổi tiếng bởi những chai vang trắng được làm từ giống nho bản địa Viura.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Thuong_thuc_ruou_vang_no_Keos_Blue_Moscato" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Thưởng thức rượu vang nổ Keos Blue Moscato</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Màu sắc: </strong>Rượu vang có màu hồng nhạt rất hấp dẫn.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Hương vị: H</strong>ương thơm của rượu là sự đan xem, hòa quyện, kết hợp của nhiều loại trái cây và gia vị đặc biệt trong đó có thể kể đến nho, táo, cam, chanh, bưởi, vanilla, hạnh nhân, hạt dẻ, gỗ sồi mang đến một hương vị hoàn hảo,</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Kết hợp món ăn:</strong> Kết hợp với hải sản, thịt trắng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Phục vụ:</strong> Nhiệt độ tuyệt vời nhất để thưởng thức rượu là 8 đến 10 độ C.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Dia_chi_mua_hang" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Địa chỉ mua hàng:</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại TP.HCM: <strong style="box-sizing: border-box;">78/k10 Cộng Hòa, P.4, Quận Tân Bình                  </strong>Hotline:<strong style="box-sizing: border-box;"> 0931.305.789</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại Hà Nội: <strong style="box-sizing: border-box;">65 Nguyễn Xuân Khoát, Ngoại Giao Đoàn              </strong>Hotline:<strong style="box-sizing: border-box;"> 0849.788.111</strong></p>', NULL, '[{"name":null,"value":null}]', '{"title":null,"keywords":null,"description":null}', 'vi', 5708),
