g></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Vang ngọt Rosso Nobile All Espresso – Hương vị Cà phê</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Ẩm thực: </strong>Kết hợp tuyệt vời với các món thịt đỏ như bò bít tết, thịt lợn nướng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Phục vụ tốt nhất khi ướp lạnh ở nhiệt độ 16 – 18 độ C.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>', NULL, '[{"name":null,"value":null}]', '{"title":"R\\u01b0\\u1ee3u vang Rosso Nobile Al Cioccolata","keywords":"R\\u01b0\\u1ee3u vang Rosso Nobile Al Cioccolata","description":"R\\u01b0\\u1ee3u vang Rosso Nobile Al Cioccolata"}', 'vi', 5724),
	(5823, 'Rượu vang Chateau Romer du Hayot Sauternes', 'khoa-van-tay-ag211-facp', 'Rượu vang Chateau Romer du Hayot Sauternes được nhập khẩu và phân phối bởi Công ty TNHH đầu tư Xuất nhập khẩu Royal (Royal Wine). Giao hàng miễn phí Toàn Quốc.', '<h2 class="product_title entry-title" font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""><span id="Gioi_thieu_ve_ruou_vang_Bordeaux" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu về rượu vang Bordeaux</span></h2>\r\n\r\n<p class="product_title entry-title" font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><span id="Bordeauxnam_o_vung_tay_nam_nuoc_Phap_la_thu_phu_cua_tinhGirondetren_bo_Dai_Tay_Duong_Noi_day_vi_tri_dia_ly_khi_hau_tho_nhuong_dac_biet_rat_phu_hop_cho_viec_trong_nho_va_san_xuat_ruou_vang_Nguoi_ta_noi_rang_nguoi_La_Ma_da_dem_giong_nho_toi_Bordeaux_Vao_the_ky_dau_tien_sau_Cong_nguyen_va_tu_do_nghe_lam_nho_da_dan_dan_phat_trien_va_tao_danh_tieng" style="box-sizing: border-box;"><strong style="box-sizing: border-box;">Bordeaux</strong> nằm ở vùng tây nam nước Pháp, là thủ phủ của tỉnh <strong style="box-sizing: border-box;">Gironde</strong> trên bờ Đại Tây Dương. Nơi đây vị trí địa lý, khí hậu thổ nhưỡng đặc biệt rất phù hợp cho việc trồng nho và sản xuất rượu vang. Người ta nói rằng người La Mã đã đem giống nho tới Bordeaux. Vào thế kỷ đầu tiên sau Công nguyên, và từ đó nghề làm nho đã dần dần phát triển và tạo danh tiếng.</span></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:="">Kể từ cuộc hôn nhân của Vua <strong style="box-sizing: border-box;">Henry II</strong> nước Anh (1154 – 1189) với Nữ công tước Eleanor xứ Aquitaine (1137 – 1204) vào thế kỷ 12. Vang Bordeaux được xuất sang Anh và được ưa chuộng trong giới quý tộc ở đây. Chính vì thế, Bordeaux dần trở thành vùng trồng nho làm rượu quan trọng bậc nhất cung cấp rượu vang cho giới quý tộc ở Anh, Pháp và châu Âu lúc bấy giờ.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""><span id="Thuong_thuc_ruou_vang_Chateau_Romer_du_Hayot_Sauternes" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Thưởng thức rượu vang Chateau Romer du Hayot Sauternes</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Màu sắc: </strong>Rượu vang có màu vàng rơm rất hấp dẫn.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Hương vị: H</strong>ương thơm của rượu là sự đan xem, hòa quyện, kết hợp của nhiều loại trái cây và gia vị đặc biệt trong đó có thể kể đến nho, táo, cam, chanh, bưởi, vanilla, hạnh nhân, hạt dẻ, gỗ sồi mang đến một hương vị hoàn hảo,</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Kết hợp món ăn:</strong> Kết hợp với hải sản, thịt trắng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: " text-align:=""><strong style="box-sizing: border-box;">Phục vụ:</strong> Nhiệt độ tuyệt vời nhất để thưởng thức rượu là 8 đến 10 độ C.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""><span id="Dia_chi_mua_hang" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Địa chỉ mua hàng:</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại TP.HCM: <strong style="box-sizing: border-box;">78/k10 Cộng Hòa, P.4, Quận Tân Bình                  </strong>Hotline:<strong style="box-sizing: border-box;"> 0931.305.789</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại Hà Nội: <strong style="box-sizing: border-box;">E3B, Ecohome 1, P. Đông Ngạc, Bắc Từ Liêm       </strong>Hotline:<strong style="box-sizing: border-box;"> 0849.788.111</strong></p>', NULL, '[{"name":null,"value":null}]', '{"title":null,"keywords":null,"description":null}', 'vi', 5742),
	(5824, 'Rượu vang nổ Valdivieso Blanc de Blanc', 'khoa-tu-ma-so-t1603-p', 'Rượu vang nổ Valdivieso Blanc de Blanc được nhập khẩu và phân phối bởi Công ty TNHH đầu tư Xuất nhập khẩu Royal (Royal Wine). Giao hàng miễn phí Toàn Quốc.', '<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Gioi_thieu_ve_ruou_vang_Chile" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu về rượu vang Chile</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Chile</strong> có thể được coi là một làn gió mới trong thế giới rượu vang. Cùng với nền rượu vang của Tân thế giới như Úc, Mỹ, Argentina, Nam Phi…Tuy nhiên các vùng trồng nho của của Chile lại có lịch sử lâu đời. Vào thế kỷ 16 khi người Tây Ban Nha đưa cây nho vào trồng ở thuộc địa của họ.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Trong thập niên 80, ngành trồng nho và sản xuất rượu vang tại Chile được khôi phục mạnh mẽ. Với việc bắt đầu giới thiệu các thùng lên men bằng Inox và sử dụng các thùng gỗ sồi để ủ rượu vang. Rượu vang của họ đã được xuất khẩu và việc sản xuất rượu vang chất lượng cao đã tăng lên rõ rệt.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Trong lĩnh rượu vang, Chile đứng thứ 7 thế giới về sản lượng rượu vang và đứng thứ 5 thế giới về xuất khẩu rượu vang.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Thuong_thuc_ruou_vang_no_Valdivieso_Blanc_de_Blanc" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Thưởng thức rượu vang nổ Valdivieso Blanc de Blanc</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Màu sắc: </strong>Rượu vang có màu vàng rơm rất hấp dẫn.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Hương vị: H</strong>ương thơm của rượu là sự đan xem, hòa quyện, kết hợp của nhiều loại trái cây và gia vị đặc biệt trong đó có thể kể đến nho, táo, cam, chanh, bưởi, vanilla, hạnh nhân, hạt dẻ, gỗ sồi mang đến một hương vị hoàn hảo,</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Kết hợp món ăn:</strong> Kết hợp với hải sản, thịt trắng…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Phục vụ:</strong> Nhiệt độ tuyệt vời nhất để thưởng thức rượu là 8 đến 10 độ C.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Dia_chi_mua_hang" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Địa chỉ mua hàng:</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Quý khách có thể đến trực tiếp Công ty hoặc liên hệ theo số hotline sau:</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại TP.HCM: <strong style="box-sizing: border-box;">78/k10 Cộng Hòa, P.4, Quận Tân Bình                  </strong>Hotline:<strong style="box-sizing: border-box;"> 0931.305.789</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Tại Hà Nội: <strong style="box-sizing: border-box;">65 Nguyễn Xuân Khoát, Ngoại Giao Đoàn              </strong>Hotline:<strong style="box-sizing: border-box;"> 0849.788.111</strong></p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "> </p>', NULL, '[{"name":null,"value":null}]', '{"title":null,"keywords":null,"description":null}', 'vi', 5743),
	(5826, 'Rượu vang Manu Marlborough Pinot Noir', 'ruou-vang-manu-marlborough-pinot-noir', NULL, '<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: "><span id="Gioi_thieu_ruou_vang_New_Zealand" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Giới thiệu rượu vang New Zealand</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">New Zealand</strong> là một quốc đảo nằm tách biệt ở Nam bán cầu trên biển Thái Bình Dương. Đất nước này có 10 vùng sản xuất rượu vang chính trải dài từ Bắc xuống Nam. Trong đó khu vực sản xuất rượu vang quan trọng nhất là Marlborough.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: ">Rượu vang New zealand khá đa dạng với nhiều dòng rượu vang. Nhưng nổi tiếng nhất vẫn là các dòng vang trắng cay nồng mùi cỏ tươi làm từ Sauvignon Blanc.</p>\r\n\r\n<h2 font-weight:="" helvetica="" segoe="" style="box-sizing: border-box; color: rgb(54, 4, 4); width: 845.5px; margin-top: 0px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 20px; line-height: 1.3; font-family: " text-align:=""><span id="Thuong_thuc_ruou_vang_Manu_Marlborough_Pinot_Noir" style="box-sizing: border-box; -webkit-box-decoration-break: clone;">Thưởng thức rượu vang Manu Marlborough Pinot Noir</span></h2>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Màu sắc: </strong>Rượu vang có màu đỏ ruby với ánh tím vô cùng đẹp mắt</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Hương vị:</strong> Hương thơm của rượu lan tỏa hương anh đào chín, dâu tây. Vị rượu thanh lịch, mịn màng, cân bằng với chất chát tròn trịa từ quá trình ngâm ủ cao cấp. Hậu vị kéo dài mang đến một cảm giác sảng khoải bất tận.</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Kết hợp món ăn:</strong> Kết hợp với các món thịt đỏ như cừu nướng, bít tết…</p>\r\n\r\n<p font-size:="" helvetica="" segoe="" style="box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: "><strong style="box-sizing: border-box;">Phục vụ:</strong> Nhiệt độ tuyệt vời nhất để thưởng thức rượu là 16 đến 18 độ C.</p>', NULL, '[{"name":null,"value":null}]', '{"title":null,"keywords":null,"description":null}', 'vi', 5745);
